    const [datos, setEquipo] = React.useState([])

    React.useEffect(() => {
        obtenerDatos()
    }, [])

    const obtenerDatos = async () => {
        const data = await fetch('http://10.0.0.12/api/usuario/consulta.php')
        const dataj = await data.json()
        setEquipo(dataj)
    }
    console.log(datos)
}
